import random
import os


def AddNTT(a_hat, b_hat):
    # AddNTT: Computes element-wise addition of two vectors
    c_hat = [((a_hat[i] + b_hat[i]) % 8380417) for i in range(256)]
    return c_hat


def MultiplyNTT(a_hat, b_hat):
    # MultiplyNTT: Computes element-wise multiplication of two vectors
    c_hat = [((a_hat[i] * b_hat[i]) % 8380417)  for i in range(256)]
    return c_hat


def AddVectorNTT(v_hat, w_hat):
    # AddVectorNTT: Computes the sum of two vectors (length 4)
    u_hat = [AddNTT(v_hat[i], w_hat[i]) for i in range(4)]
    return u_hat


def ScalarVectorNTT(c_hat, v_hat):
    # ScalarVectorNTT: Computes the product of a scalar and a vector (length 4)
    w_hat = [MultiplyNTT(c_hat, v_hat[i]) for i in range(4)]
    return w_hat

def MatrixVectorNTT(M_hat, v_hat):
    # MatrixVectorNTT: Computes the product of a matrix M_hat and a vector v_hat
    k = len(M_hat)  # Number of rows in M_hat
    l = len(v_hat)  # Number of elements in v_hat
    w_hat = [[0] * 256 for _ in range(k)]  # Initialize w_hat with zeros
    for i in range(k):
        for j in range(l):
            temp = MultiplyNTT(M_hat[i][j], v_hat[j])
            w_hat[i] = AddNTT(w_hat[i], temp)
            if(j==0):
                 print(temp)
            # for p in w_hat[i]:
            #     with open("MATRIX_golden_data.txt", "a") as file:  # "w" 代表寫入模式，會覆蓋原內容
            #         file.write(f"{p}\n")
    return w_hat


